import React from "react";
import Card from "../UI/Card";
import services1 from '../assets/services1.jpg'
import "../css/pricing.css";
import Offer from "../UI/Offer";

const Pricing = () => {
  return (
    <div className="pricing-wrapper" id="pricing">
      <div className="pricing-header">
      <h3>
        <box-icon name="cut" size="3rem" animation="tada" color='#fff'></box-icon>
        Pricing
      </h3>
      </div>
      <div className="pricing">
        <Offer title='Full Option' time='40-60min' price=''/>
        <Offer title='Hair Color & Styling' time='' price=''/>
        <Offer title='Hair Styling' time='' price=''/>
        <Offer title='Beard Styling' time='' price=''/>
      </div>
      </div>
  );
};

export default Pricing;
